import Button from "./Button";
import FormAddFriend from "./FormAddFriend";
function FriendsList({ friends }) {
  return (
    <div>
      <ul>
        {friends.map((friend) => (
          <Friend friend={friend} key={friend.id} />
        ))}
      </ul>
      <Button>Add friend</Button>
    </div>
  );
}
export default FriendsList;
